import React from 'react';
import { ChakraProvider, Box} from '@chakra-ui/react';

function App() {
  return (
    <ChakraProvider>
      <Box backgroundColor="pink"
      minH="100vh"
      padding="30px 60px 60px 20px"
      >
        <Box 
        backgroundColor="white"
        minW="400px"
        minH="200px"
        padding="50px"
        >

        </Box>
      </Box>
    </ChakraProvider>
  );
}

export default App;
